1.1 - O OBJETO DO PRESENTE INSTRUMENTO É A CONTRATAÇÃO DE SERVIÇOS DE ADMINISTRAÇÃO, GERENCIAMENTO E CONTROLE COM AUTOGESTÃO DE FROTA DE VEÍCULOS PARA MANUTENÇÃO PREVENTIVA E CORRETIVA, INCLUINDO FORNECIMENTO DE PEÇAS DE REPOSIÇÃO, ACESSÓRIOS, COMPONENTES E MATERIAIS RECOMENDADOS PELOS FABRICANTES EQUIPAMENTOS, SOCORRO MECÂNICO, TRANSPORTE POR GUINCHO E LAVAGEM/HIGIENIZAÇÃO DE TODA FROTA DE VEÍCULOS LEVES E PESADOS, IMPLEMENTOS E MÁQUINAS AGRÍCOLAS, MOTORES GERADORES DE ENERGIA ESTACIONÁRIOS, CORTADORES E MÁQUINAS DIVERSAS, POR MEIO DE REDE DE ESTABELECIMENTOS CREDENCIADOS E SISTEMA INFORMATIZADO PARA ATENDER ÀS NECESSIDADES DOS CAMPI DA UNIVERSIDADE FEDERAL DE SÃO JOÃO DEL-REI, QUE SERÃO PRESTADOS NAS CONDIÇÕES ESTABELECIDAS NO TERMO DE REFERÊNCIA, ANEXO DO EDITAL.
1.2 - ESTE TERMO DE CONTRATO VINCULA-SE AO EDITAL DO PREGÃO, IDENTIFICADO NO PREÂMBULO E À PROPOSTA VENCEDORA, INDEPENDENTEMENTE DE TRANSCRIÇÃO.
1.3 - OBJETO DA CONTRATAÇÃO:

ITEM DESCRIÇÃO VALORES
01 PEÇAS R$ 143.722,08
02 SERVIÇOS R$ 98.112,87
CLÁUSULA SEGUNDA - VIGÊNCIA

2.1 - O PRAZO DE VIGÊNCIA DESTE TERMO DE CONTRATO É AQUELE FIXADO NO EDITAL, COM INÍCIO NA DATA DE 25/05/2022 E ENCERRAMENTO EM 25/05/2023, PODENDO SER PRORROGADO POR INTERESSE DAS PARTES ATÉ O LIMITE DE 60 (SESSENTA) MESES, DESDE QUE HAJA AUTORIZAÇÃO FORMAL DA AUTORIDADE COMPETENTE E OBSERVADOS OS SEGUINTES REQUISITOS:

2.1.1 -OS SERVIÇOS TENHAM SIDO PRESTADOS REGULARMENTE;
2.1.2 -ESTEJA FORMALMENTE DEMONSTRADO QUE A FORMA DE PRESTAÇÃO DOS SERVIÇOS TEM NATUREZA CONTINUADA;
2.1.3 -SEJA JUNTADO RELATÓRIO QUE DISCORRA SOBRE A EXECUÇÃO DO CONTRATO, COM INFORMAÇÕES DE QUE OS SERVIÇOS TENHAM SIDO PRESTADOS REGULARMENTE;
2.1.4 -SEJA JUNTADA JUSTIFICATIVA E MOTIVO, POR ESCRITO, DE QUE A ADMINISTRAÇÃO MANTÉM INTERESSE NA REALIZAÇÃO DO SERVIÇO;
2.1.5 -SEJA COMPROVADO QUE O VALOR DO CONTRATO PERMANECE ECONOMICAMENTE VANTAJOSO PARA A ADMINISTRAÇÃO;
2.1.6 - HAJA MANIFESTAÇÃO EXPRESSA DA CONTRATADA INFORMANDO O INTERESSE NA PRORROGAÇÃO;
2.1.7 - SEJA COMPROVADO QUE O CONTRATADO MANTÉM AS CONDIÇÕES INICIAIS DE HABILITAÇÃO.
2.1.8 - A CONTRATADA NÃO TEM DIREITO SUBJETIVO À PRORROGAÇÃO CONTRATUAL.
2.2 - A PRORROGAÇÃO DE CONTRATO DEVERÁ SER PROMOVIDA MEDIANTE CELEBRAÇÃO DE TERMO ADITIVO.
